import React, { useState, useEffect } from "react";
import { View, Text, TouchableOpacity, Button } from "react-native";
import { Appbar } from 'react-native-paper';
import { Menu, MenuItem, MenuDivider } from 'react-native-material-menu';
import { Col, Grid } from "react-native-easy-grid";
import Share from 'react-native-share';

const Home = ({ navigation }) => {

    const URL = "data:image/jpeg;base64,";
    const [herramientas, setHerramientas] = useState(false);

    const accion = () => {
        alert("Accion");
    }

    useEffect(() => {
        headerBar(herramientas);
    });

    const Header = ({titleName, botones}) => {

        const [visible, setVisible] = useState(false);
        const hideMenu = () => setVisible(false);
        const showMenu = () => setVisible(true);
        return (
            <Grid>
                <Col>
                    <Appbar.Action icon="menu" onPress={() => navigation.openDrawer() } />
                </Col>
                <Col style={{justifyContent: 'center'}}>
                    <Text>{titleName}</Text>
                </Col>
                {(botones)? 
                (
                    <>
                        <Col>
                            <Appbar.Action icon="menu" onPress={() => accion() } />
                        </Col>
                        <Col>
                            <Appbar.Action icon="menu" onPress={() => accion() } />
                        </Col>
                        <Col>
                            <Appbar.Action icon="menu" onPress={() => accion() } />
                        </Col>
                        <Menu
                            visible={visible}
                            anchor={
                                <Col>
                                    <Appbar.Action icon="menu" onPress={() => showMenu() } />
                                </Col>
                            }
                            onRequestClose={hideMenu}>
                            <MenuItem onPress={() => accion() }>Menu item 1</MenuItem>
                            <MenuItem onPress={() => accion() }>Menu item 2</MenuItem>
                            <MenuItem disabled>Disabled item</MenuItem>
                            <MenuDivider />
                            <MenuItem onPress={() => accion() }>Menu item 4</MenuItem>
                        </Menu>
                    </>
                ):
                (
                    <></>
                )
                }
            </Grid>
        );
    }

    const headerBar = (botones) => {
        navigation.setOptions({ headerTitle: () => <Header titleName="Home" botones={botones}/> });
    }

    const convertirBase64 = (archivo) => {
        Array.from(archivo).forEach((archivo) => {
            var reader = new FileReader();
            reader.readAsDataURL(archivo);
            reader.onload = function(){
                var arrayAuxiliar = [];
                var base64 = reader.result;
                arrayAuxiliar = base64.split(',');
                console.log(arrayAuxiliar[1]);
            }
        });
    }

    const compartir = async() => {
        const options = {
            message: "Prueba",
            url: URL,
            //urls: [ URL1, URL2, ...];
        }
        Share.open(options)
            .then((res) => {
                console.log(JSON.stringify(res));
            })
            .catch((err) => {
                console.log("Error => ", err);
            });
    }

    return (
        <View>
            <TouchableOpacity onPress={() => herramientas? setHerramientas(false):setHerramientas(true) }>
                <Text>Herramientas {herramientas? "Ocultar":"Mostrar"}</Text>
            </TouchableOpacity>
            <Button title="Compartir" onPress={() => compartir() }/>
        </View>
    );
}

export default Home;